import React from "react";
import styled from "styled-components";
import { Route } from "react-router-dom";
import Home from "./routes/Home";
const App = () => {
    return (
        <Application>
            <Route path='/' component={Home} />
        </Application>
    );
};
const Application = styled.div``;
export default App;
